import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const PendingUsers = () => {
  const [pendingUsers, setPendingUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("http://localhost:5005/api/pending-users")
      .then((response) => response.json())
      .then((data) => {
        setPendingUsers(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching pending users:", error);
        setLoading(false);
      });
  }, []);

  const approveUser = async (userId) => {
    try {
      const response = await axios.put(`http://localhost:5005/api/approve-user/${userId}`);
      alert(response.data.message);
      setPendingUsers((prevState) => prevState.filter((user) => user._id !== userId));
    } catch (err) {
      console.error("Error approving user:", err);
      alert("Failed to approve user");
    }
  };

  const rejectUser = async (userId) => {
    try {
      const response = await axios.delete(`http://localhost:5005/api/reject-user/${userId}`);
      alert(response.data.message);
      setPendingUsers((prevState) => prevState.filter((user) => user._id !== userId));
    } catch (err) {
      console.error("Error rejecting user:", err);
      alert("Failed to reject user");
    }
  };

  return (
    <div className="p-6 bg-gray-100 min-h-screen">
      <h2 className="text-2xl font-semibold text-gray-800 mb-4">Pending Users</h2>
      {loading ? (
        <p className="text-gray-600">Loading...</p>
      ) : pendingUsers.length === 0 ? (
        <p className="text-gray-600">No pending users</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white shadow-md rounded-lg">
            <thead className="bg-blue-500 text-white">
              <tr>
                <th className="py-3 px-4 text-left">Client Name</th>
                <th className="py-3 px-4 text-left">Status</th>
                <th className="py-3 px-4 text-left">Industry</th>
                <th className="py-3 px-4 text-left">Email</th>
                <th className="py-3 px-4 text-left">Phone</th>
                <th className="py-3 px-4 text-left">Contact Person</th>
                <th className="py-3 px-4 text-left">Action</th>
              </tr>
            </thead>
            <tbody>
              {pendingUsers.map((user) => (
                <tr key={user._id} className="border-b hover:bg-gray-100">
                  <td className="py-3 px-4">
                    <Link to={`/client/${user._id}`} className="text-blue-600 hover:underline">
                      {user.client_name}
                    </Link>
                  </td>
                  <td className="py-3 px-4">{user.status}</td>
                  <td className="py-3 px-4">{user.industry}</td>
                  <td className="py-3 px-4">{user.email}</td>
                  <td className="py-3 px-4">{user.phone}</td>
                  <td className="py-3 px-4">{user.contact_person}</td>
                  <td className="py-3 px-4">
                    <button
                      className="bg-green-500 text-white px-4 py-2 rounded-md mr-2 hover:bg-green-600"
                      onClick={() => approveUser(user._id)}
                    >
                      Approve
                    </button>
                    <button
                      className="bg-red-500 text-white px-4 py-2 rounded-md hover:bg-red-600"
                      onClick={() => rejectUser(user._id)}
                    >
                      Reject
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default PendingUsers;
